import React from 'react';
import { BrowserRouter, Routes, Route, useNavigate } from 'react-router-dom';
import Navigation from './components/Navigation';
import HomePage from './pages/HomePage';
import AboutUs from './pages/AboutUs';
import IntakeForms from './pages/IntakeForms';
import StudentRegistrationForm from './pages/forms/StudentRegistrationForm';
import ThriveIntakeForm from './pages/forms/ThriveIntakeForm';

export type PageType = 'home' | 'intake' | 'about' | 'studentRegistration' | 'thriveIntake';

const AppContent = () => {
  const navigate = useNavigate();

  return (
    <div className="font-sans">
      <Navigation navigate={navigate} />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/intake" element={<IntakeForms navigate={navigate} />} />
        <Route path="/about" element={<AboutUs />} />
        <Route path="/forms/student-registration" element={<StudentRegistrationForm />} />
        <Route path="/forms/thrive-intake" element={<ThriveIntakeForm />} />
      </Routes>
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      <AppContent />
    </BrowserRouter>
  );
};

export default App;
